"use strict";function initMap(){var a=$("#latitude").html(),b=$("#longitude").html(),c={lat:+a,lng:+b},d=new google.maps.Map(document.getElementById("map"),{center:c,zoom:10});new google.maps.Marker({position:c,map:d,title:"Competition!"});google.maps.event.addListenerOnce(d,"idle",function(){setTimeout(function(){google.maps.event.trigger(d,"resize")},1e3)})}